import React from "react";
import "./PollingScreen.styles.css";

const PollingScreen = ()=>{
    return(
        <div className="container">
            <div className="polling-list">
            <h2>Which is your favourite framework?</h2>
            <div className="option">Angular JS</div>
            <div className="option">React JS</div>
            <div className="option">Vue JS</div>
            <div className="option">Vanilla JS</div>
            </div>

        </div>
    )
}



export default PollingScreen;
